import React from 'react';
import { BrowserRouter, Routes, Route, Link } from 'react-router-dom';

import AddAirplaneForm         from './components/AddAirplaneForm';
import ViewAirplanes           from './components/ViewAirplanes';

import AddAirportForm          from './components/AddAirportForm';
import ViewAirports            from './components/ViewAirports';

import AddPersonForm           from './components/AddPersonForm';
import ViewPersons             from './components/ViewPersons';

import AddPassengerBoardForm   from './components/AddPassengerBoardForm';

import OfferFlightForm         from './components/OfferFlightForm';
import FlightsList             from './components/FlightsList';

import ToggleLicenseForm       from './components/ToggleLicenseForm';
import PilotLicensesList       from './components/PilotLicensesList';

import FlightLandingForm       from './components/FlightLandingForm';

import FlightsInAir            from './components/FlightsInAir';
import FlightsOnGround         from './components/FlightsOnGround';
import PeopleInAir             from './components/PeopleInAir';
import PeopleOnGround          from './components/PeopleOnGround';
import RouteSummary            from './components/RouteSummary';
import AlternateAirports       from './components/AlternateAirports';

export default function App() {
  return (
    <BrowserRouter>
      <nav style={{ padding: '1rem', borderBottom: '1px solid #ddd' }}>
        <Link to="/"                    style={{ marginRight:'1rem' }}>Home</Link>

        {/* Airplanes */}
        <Link to="/add_airplane"        style={{ marginRight:'0.5rem' }}>Add Airplane</Link>
        <Link to="/view_airplanes"      style={{ marginRight:'1rem' }}>View Airplanes</Link>

        {/* Airports */}
        <Link to="/add_airport"         style={{ marginRight:'0.5rem' }}>Add Airport</Link>
        <Link to="/view_airports"       style={{ marginRight:'1rem' }}>View Airports</Link>

        {/* People */}
        <Link to="/add_person"          style={{ marginRight:'0.5rem' }}>Add Person</Link>
        <Link to="/view_persons"        style={{ marginRight:'1rem' }}>View People</Link>

        {/* Flight Ops */}
        <Link to="/passengers_board"    style={{ marginRight:'1rem' }}>Board Passengers</Link>
        <Link to="/offer_flight"        style={{ marginRight:'1rem' }}>Offer Flight</Link>
        <Link to="/flights"             style={{ marginRight:'1rem' }}>View Flights</Link>

        {/* Licenses */}
        <Link to="/toggle_license"      style={{ marginRight:'1rem' }}>Toggle License</Link>
        <Link to="/pilot_licenses"      style={{ marginRight:'1rem' }}>View Licenses</Link>

        {/* Landing */}
        <Link to="/flight_landing"      style={{ marginRight:'1rem' }}>Flight Landing</Link>

        {/* Views */}
        <Link to="/flights_in_air"      style={{ marginRight:'1rem' }}>Flights in the Air</Link>
        <Link to="/flights_on_ground"   style={{ marginRight:'1rem' }}>Flights on the Ground</Link>
        <Link to="/people_in_air"       style={{ marginRight:'1rem' }}>People in the Air</Link>
        <Link to="/people_on_ground"    style={{ marginRight:'1rem' }}>People on the Ground</Link>
        <Link to="/route_summary"       style={{ marginRight:'1rem' }}>Route Summary</Link>
        <Link to="/alternate_airports"  style={{ marginRight:'1rem' }}>Alternate Airports</Link>
      </nav>

      <Routes>
        <Route path="/" element={<p style={{ padding:'2rem' }}>Select an action above.</p>} />

        {/* Airplanes */}
        <Route path="/add_airplane"     element={<AddAirplaneForm      />} />
        <Route path="/view_airplanes"   element={<ViewAirplanes        />} />

        {/* Airports */}
        <Route path="/add_airport"      element={<AddAirportForm       />} />
        <Route path="/view_airports"    element={<ViewAirports         />} />

        {/* People */}
        <Route path="/add_person"       element={<AddPersonForm        />} />
        <Route path="/view_persons"     element={<ViewPersons          />} />

        {/* Boarding */}
        <Route path="/passengers_board" element={<AddPassengerBoardForm />} />

        {/* Flight Ops */}
        <Route path="/offer_flight"     element={<OfferFlightForm      />} />
        <Route path="/flights"          element={<FlightsList          />} />

        {/* Licenses */}
        <Route path="/toggle_license"   element={<ToggleLicenseForm    />} />
        <Route path="/pilot_licenses"   element={<PilotLicensesList    />} />

        {/* Landing */}
        <Route path="/flight_landing"   element={<FlightLandingForm    />} />

        {/* Views */}
        <Route path="/flights_in_air"   element={<FlightsInAir         />} />
        <Route path="/flights_on_ground"element={<FlightsOnGround     />} />
        <Route path="/people_in_air"    element={<PeopleInAir          />} />
        <Route path="/people_on_ground" element={<PeopleOnGround       />} />
        <Route path="/route_summary"    element={<RouteSummary         />} />
        <Route path="/alternate_airports"element={<AlternateAirports />} />

        <Route path="*" element={<p style={{ padding:'2rem' }}>Page not found.</p>} />
      </Routes>
    </BrowserRouter>
  );
}
